import React from "react";

function SelfPaje(props)
{
    const uId = async () =>{
        const token= await getToken();
        if(token==null)
          return null;
        const data = await GetId();
        setId(data.id)
    }
    uId();
    return(<h1>{props.id}</h1>)
}
export default SelfPaje
